	file6 := &embedded.EmbeddedFile{
		Filename:    "caution.html",
		FileModTime: time.Unix(1570139278, 0),

		Content: string("<!DOCTYPE html>\n<html>\n    <head>\n        <meta charset=\"utf-8\">\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n        <title>WxAlert Support</title>\n        <link rel=\"stylesheet\" href=\"./styles/card.css\">\n        <link rel=\"stylesheet\" href=\"./styles/nav.css\">\n        <link rel=\"stylesheet\" href=\"./styles/alert.css\">\n        <link rel=\"stylesheet\" href=\"./styles/style.css\">\n\n        <!--Favicon-->\n        <link rel=\"apple-touch-icon\" sizes=\"180x180\" href=\"/apple-touch-icon.png\">\n        <link rel=\"icon\" type=\"image/png\" sizes=\"32x32\" href=\"/favicon-32x32.png\">\n        <link rel=\"icon\" type=\"image/png\" sizes=\"16x16\" href=\"/favicon-16x16.png\">\n        <link rel=\"manifest\" href=\"/site.webmanifest\">\n\n    </head>\n    <body>\n         <header>\n            <nav class=\"navbar\">\n                <label class=\"navbar-toggle\" id=\"js-navbar-toggle\" for=\"chkToggle\">\n                    <i class=\"hamburger\"></i>Menu\n                </label>\n                <a href=\"./\" class=\"logo\"><img src=\"./images/logo/app_icon64.png\"></a>\n                <input type=\"checkbox\" id=\"chkToggle\"></input>\n                <ul class=\"main-nav\" id=\"js-menu\">\n                    <li>\n                        <a href=\"./\" class=\"nav-links\">Home</a>\n                    </li>\n                    <li>\n                        <a href=\"./ui.html\" class=\"nav-links\">UI</a>\n                    </li>\n                    <li>\n                        <a href=\"./weather.html\" class=\"nav-links\">Weather</a>\n                    </li>\n                    <li>\n                        <a href=\"./alert.html\" class=\"nav-links\">Alert</a>\n                    </li>\n                    <li>\n                        <a href=\"./caution.html\" class=\"nav-links\">Caution</a>\n                    </li>\n                    <li>\n                        <a href=\"./contact.html\" class=\"nav-links\">Contact</a>\n                    </li>\n                </ul>\n            </nav>\n        </header>\n\n        <main class=\"main\">\n            <section>\n                <h1>Caution Icon</h1>\n                <p>Each alert notification displayed at the top of the weather view page has an associated caution icon. Like alert icons,\n                    caution icons are of three categories:\n                    <ol>\n                        <li>Advisory / Statement</li>\n                        <li>Watch</li>\n                        <li>Warning</li>\n                    </ol>\n                </p>\n                <div id=\"badge_count\">\n                    <h2>Alert Counter</h2>\n                    <img class=\"img-badge\" src=\"./images/screenshot/screen_badge.jpg\" alt=\"badge count\">\n                        <p>\n                            Only the most recent caution icon will be shown for any forecast day. In the case where several alert notifications are posted \n                            in the forecast for that day, a red badge icon with a count will be displayed next to the caution icon. Whenever a caution icon \n                            is shown in the weather forecast, tapping on the icon displays further details of the alert notification. Swiping on the alert \n                            detail view will reveal another alert detail if the badge count is greater than one.\n                        </p>\n                </div>\n            </section>\n            <section>\n                <table style=\"width:100%\">\n                    <caption><strong>Caution Icon Types</strong></caption>\n                    <thead>\n                        <tr>\n                            <th class=\"row-icon\">Icon</th>\n                            <th class=\"row-desc\">Description</th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_advisory.png\" alt=\"advisory\"></td>\n                            <td>Advisory weather notification</td>\n                        </tr>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_watch.png\" alt=\"watch\"></td>\n                            <td>Watch weather notification.</td>\n                        </tr> \n                        <tr>\n                            <td><img src=\"./images/caution/dia_warning.png\" alt=\"warning\"></td>\n                            <td>Warning weather notification.</td>\n                        </tr>             \n                    </tbody>         \n                </table>\n            </section>\n            <section>\n                <h2>Advisory Icons</h2>\n                <table style=\"width:100%\">\n                    <caption><strong>Advisory / Statement Icons</strong></caption>\n                    <thead>\n                        <tr>\n                            <th class=\"row-icon\">Icon</th>\n                            <th class=\"row-desc\">Description</th>\n                        </tr>                                \n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td><img src=\"./images/screenshot/screen_badge.jpg\" alt=\"screen_badge\"></td>\n                            <td>Badge count indicates the number of weather alerts issued.</td>\n                        </tr>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_advis_blizz.png\" alt=\"blizzard\"></td>\n                            <td>Blizzard advisory.</td>\n                        </tr>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_advis_flood.png\" alt=\"flooding\"></td>\n                            <td>Flood advisory.</td>\n                        </tr> \n                        <tr>\n                            <td><img src=\"./images/caution/dia_advis_ssurge.png\" alt=\"storm surge\"></td>\n                            <td>Storm surge advisory.</td>\n                        </tr>   \n                        </tbody>\n                </table>\n            </section>\n            <section>\n                <h2>Watch Icons</h2>\n                    <table style=\"width:100%\">\n                    <caption><strong>Watch Icons</strong></caption>\n                        <thead>\n                            <tr>\n                                <th class=\"row-icon\">Icon</th>\n                                <th class=\"row-desc\">Description</th>\n                            </tr>                               \n                        </thead>\n                        <tbody>\n                            <tr>\n                                <td><img src=\"./images/caution/dia_watch_fldlakeshore.png\" alt=\"lake shore flooding\"></td>\n                                <td>Lake shore flooding.</td>\n                            </tr>\n                            <tr>\n                                <td><img src=\"./images/caution/dia_watch_freeze.png\" alt=\"freeze\"></td>\n                                <td>Freeze watch.</td>\n                            </tr> \n                            <tr>\n                                <td><img src=\"./images/caution/dia_watch_windchill.png\" alt=\"wind chill\"></td>\n                                <td>Wind chill watch.</td>\n                            </tr>                   \n                        </tbody>\n                    </table>\n            </section>\n            <section>\n                <h2>Warning Icons</h2>\n                    <table style=\"width:100%\">\n                        <caption><strong>Warning Icons</strong></caption>\n                    <thead>\n                        <tr>\n                            <th class=\"row-icon\">Icon</th>\n                            <th class=\"row-desc\">Description</th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_warn_icestorm.png\" alt=\"ice storm\"></td>\n                            <td>Ice storm warning.</td>\n                        </tr>\n                        <tr>\n                            <td><img src=\"./images/caution/dia_warn_ripcurrent.png\" alt=\"rip current\"></td>\n                            <td>Rip current warning.</td>\n                        </tr> \n                        <tr>\n                            <td><img src=\"./images/caution/dia_warn_tropicalstorm.png\" alt=\"tropical storm\"></td>\n                            <td>Tropical storm warning.</td>\n                        </tr>            \n                    </tbody>\n                </table>\n            </section>\n        </main>\n \n        <footer>\n            <hr>\n            <p>&copy; wxalert</p>\n        </footer>\n    </body>\n</html>    "),
	}
